r($,"aM7","mi",()=>A.a([A.XL("assets/program/ta.jpg","The common core curriculum ensures the mastery of a diverse range of skills encompassing:\n\n- Analysis for Engineering\n- Integral and Probability\n- Advanced Algorithmic and Programming (C,C++)\n- Physics for Engineering\n- Fluid Mechanics\n- Electrical Systems\n- Semiconductors\n- English \n- Numerical Analysis & Optimization\n- Statistics for Engineering\n- Object-oriented programming \n- Thermodynamics for Engineering\n- Electronics\n- Servo and industry regulation\n- Law\n- Economy and green economy\n- Operational Research 1\n- Artificial Intelligence\n- Thermal Transfer\n- Materials physics\n- Project Management\n- Team Management\n- Deutsch or Japanese Language\n\nThe comprehensive curriculum empowers students to develop expertise in industrial engineering and management, enabling them to address complex challenges. Through theoretical learning, practical projects, and exposure to modern methodologies, students build a strong foundation to optimize industrial processes and manage operations effectively, preparing them for the dynamic industrial landscape.","Common Core"),A.XL("assets/program/setp.jpg","Being a student engineer in SETP (Energy Systems and Renewable Energies) can ensure the acquisition of various skills, including:\n\n- Artificial Intelligence (AI)\n- Programmable Automation\n- Electrical Machinery and Static Converters\n- Thermal Energy Conversion\n- Internet of Things (IoT) and Cloud Computing\n- Big Data\n- Smart Grids\n- Electronic Functions\n- Small and Medium-sized Enterprises (SME)\n- Nuclear Techniques\n- Energy Auditing and Energy Management\n- Electrical Systems of Renewable Energy\n- hydrogen energy \n\nIn the SETP program, students have the opportunity to develop expertise in these areas, equipping them to tackle challenges in the evolving field of energy technology. Through a comprehensive curriculum, hands-on projects, and exposure to cutting-edge technologies, students can cultivate a strong foundation in a wide range of subjects related to energy systems and renewable technologies.","Energy systems and clean technologies (SETP)"),A.XL("assets/program/sic.jpg","Being a student engineer in SIC (Industrial Engineering and Management) can ensure the acquisition of various skills, including:\n\n- Supply Chain Management\n- Quality System Management\n- Technical Consulting\n- Procurement and Supply\n- Integrated Management Systems\n- SAP Development\n- Enterprise Resource Planning (ERP)\n- Risk Management\n- Operations Management\n- Industry 4.0 and Internet of Things (IoT)\n- Six Sigma Methodology\n- Lean Management\n\nIn the SIC program, students have the opportunity to develop expertise in these domains, preparing them to address complex challenges in the realm of industrial engineering and management. Through a comprehensive curriculum, practical projects, and exposure to modern methodologies and technologies, students can build a strong foundation across a diverse spectrum of subjects related to optimizing industrial processes and managing complex operations.","Industrial systems and competitiveness (SIC)"),A.XL("assets/program/ean.jpg","Being a student engineer in EAN (Electronic Systems and Automation) can ensure the acquisition of various skills, including:\n\n- Design of Electronic Systems\n- Fabrication Technologies and MEMS\n- Microwave Electronics\n- Fabrication and Characterization Techniques of Nanomaterials\n- Reconfigurable Systems Architecture\n- Video Processing\n- Robotics\n- Interface and Communication of Embedded Systems\n- Methodologies for Embedded Digital Circuit Design\n- Graphical Programming\n- Microsystem Modeling\n- Nanotechnologies Applied to Components\n\nIn the EAN program, students have the opportunity to develop expertise in these areas, preparing them to address complex challenges in the field of electronic systems and automation. Through a comprehensive curriculum, hands-on projects, and exposure to cutting-edge technologies, students can build a strong foundation across a diverse range of subjects related to designing, optimizing, and implementing electronic systems and technologies.","Advanced electronics and nanotechnologies (EAN)")],A.a_("u<Fj>")))
r($,"aM5","TV",()=>A.a([A.Fe("As an IEEE Student Chapter, our mission is to advance technology and improve social statuses through a diverse range of projects and initiatives. Through technical projects, workshops, and seminars, we aim to foster innovation and technical excellence among our members. Additionally, we are committed to making a positive social impact by engaging in projects that address real-world challenges faced by our community. By organizing community outreach programs, hackathons, and competitions, we seek to promote STEM education, creativity, and problem-solving skills. Upholding ethical standards and professionalism, we encourage our members to contribute to research and publications, expanding knowledge in various fields. Networking, collaboration, and leadership development opportunities are offered to empower our members to succeed in their future careers while making meaningful contributions to society. Through recognition and awards, we celebrate achievements and motivate our members to continue their dedication to creating a better world through technology and social responsibility.","assets/associations/enstab_ieee.png","ENSTAB IEEE SB",122),A.Fe("ETC (Energetic Technological Consulting) is a dynamic office of studies and consultancy, playing a vital role in the global Junior Enterprise Movement, with a strong focus on the domains of energy, technology, and industry. As a part of this influential movement, ETC is driven by a passion for innovation and excellence, aiming to make a significant impact in these pivotal sectors. Through its specialized expertise, ETC endeavors to provide cutting-edge solutions and strategic insights to clients, driving progress and fostering sustainable development. With a team of dedicated and skilled young professionals, ETC thrives in delivering high-quality services that cater to the evolving demands of the energy and technology landscape. Its commitment to staying at the forefront of industry advancements and best practices empowers ETC to continuously adapt and thrive in an ever-changing market. As a result, ETC emerges as a trusted partner, driving positive change and contributing to the advancement of energy, technology, and industry worldwide.","assets/associations/ETC_Logo.png","ETC",122),A.Fe("GDSC ENSTAB is a Google Developer Student Club founded at the National School of Advanced Sciences and Technologies of Borj Cedria. The club aims to promote new technologies and provide a peer-to-peer learning environment for students to grow their knowledge. By joining the club, students can build solutions for local businesses and their communities. The club hosts workshops and events to help students learn about developer products and platforms through hands-on activities. GDSC ENSTAB also works with local partners to lead project building activities. The official website of ENSTAB mentions that the school's engineers will be able to work in many advanced industrial sectors in Tunisia or abroad, such as aeronautics. GDSC ENSTAB has a Twitter account where they share updates about their activities and events. Students can learn more about GDSC ENSTAB and their upcoming events by visiting their page on the Google Developer Student Clubs website.","assets/associations/gdsc_enstab.png","GDSC",122),A.Fe("NATEG Enstab is a student chapter or group associated with ENSTAB, the National School of Advanced Sciences and Technologies of Borj Cedria in Tunisia.and aims to build networks and bridges between Tunisians in Tunisia and those in North America.","assets/associations/nateg_enstab.jpg","NATEG",122),A.Fe("Electronix Enstab, founded by exceptionally talented students of Enstab with a passion for electronics, serves as a platform to cultivate an enduring love for electronics among engineering students. Committed to making this discipline accessible to all, Electronix Enstab seamlessly integrates electronics and programming, welcoming both beginners and advanced individuals seeking to refine their skills. The club's core mission revolves around the captivating world of robotics, with a particular emphasis on designing and crafting robots, including the impressive quadruped robot, among an array of other innovative projects. By actively participating in a multitude of competitions, Electronix Enstab continually challenges its members, fostering growth and excellence in the field. With a vibrant community of like-minded individuals, the club thrives on collaboration and knowledge-sharing, encouraging each member to push their boundaries and contribute to the advancement of electronics and robotics.",u.B,"ELECTRONIX",122)],A.a_("u<Fd>")))
r($,"aMs","aw1",()=>{var q="ensta_robots_"
return A.a([A.XH('The inaugural ENSTA ROBOTS event has been officially launched, generating great excitement for what lies ahead. Presented by ELECTRONIX ENSTAB & IEEE ENSTAB SB, this robotics competition, themed "ESCAPING THE ICE AGE," features three captivating subcompetitions: Artificial Intelligence, All Terrain/Line Follower, and Sumo Fight. Prepare for a novel experience with innovative robotics challenges that have never been seen before in the country. Mark your calendars for the event date: 01/03/2020 at the National School of Sciences and Advanced Technologies of Borj Cedria (ENSTA Borj Cedria). It\'s a promise of ultimate fun and discovery!',"assets/associations/electronix/events/ensta_robots_1/ensta_robots_8.jpg",A.eT("assets/associations/electronix/events/ensta_robots_1",q,10),!0,"ENSTAROBOT 1 | ACE AGE"),A.XH("In the year 3000, humanity's advanced space civilization faces an alien invasion after successfully colonizing the seventh galaxy. The struggle for freedom begins against technologically superior invaders. The ENSTA ROBOTS' second edition is unveiled, hosted by ELECTRONIX ENSTAB & IEEE ENSTAB SB. The competition, themed \"A BATTLE BEYOND THE HORIZON,\" features 5 subcompetitions: Smart Robot, All Terrain, Line Follower, Sumo Fight, and Junior Model. Get ready for an exciting robotics showcase!","assets/associations/electronix/events/ensta_robots_2/ensta_robots_1.jpg",A.eT("assets/associations/electronix/events/ensta_robots_2",q,10),!0,"ENSTAROBOTS 2"),A.XH("The historic core of Tunis holds a rich history spanning from the Middle Ages to the Islamic era, evident in its 700 monuments like palaces, mosques, and schools. This area was once among the most affluent cities in the Islamic world. Enclosed by a continuous wall, the oval-shaped medina features a prominent Kasbah serving as the government hub. The Great Mosque of Ezzaitouna is the religious center, adjoining a vast platform used as a marketplace, public space, and parade ground. Narrow lanes hold traditional houses around bustling souks. ELECTRONIX ENSTAB presents a theme centered on this unique medina, offering participants a journey through its heart. The initiative encourages starting at the origin within the old city of Tunis and embarking on a robotic exploration toward the gates. The goal is to highlight the Medina's significance and foster pride as participants exhibit their robotics expertise.","assets/associations/electronix/events/ensta_robots_3/ensta_robots_11.jpg",A.eT("assets/associations/electronix/events/ensta_robots_3",q,10),!0,"ENSTAROBOTS 3 | DOULICHA IN MEDINA")],A.a_("u<mG>"))})
r($,"aM9","avO",()=>A.a([A.XH('"My town called that game "the squid game" it was named so because the game was played in a squid-like outline.\nThe rules are simple " Squid Game\nHave you been dreaming of the Squid Game experience, with a happier ending than in the series?\nIt\'s about to happen, but this time with rules set by ENICarthage Robots.\nThe ENICarthage Robots 6.0 competition follows the story of a hundred robots who come together to overcome challenges and pass tests inspired by the games of our childhood.\nSo if you\'ve got a knack for the world of robotics, we\'re honored to welcome you on February 20, 2022 to experience unforgettable moments and share in the good sense of innovation and competition. ',"assets/associations/enstab_competitions/enicarth_competition.jpg",A.eT("assets/associations/electronix/participation","ensta_robots_",10),!1,"ENICARTHAGE ROBOT 6")],A.a_("u<mG>")))
r($,"aMm","avZ",()=>A.a([new A.FX("Description","The Helix project is a partnership between Institute of Critical Languages and Cultural Exchange, Incorporated, Southern University Continuing Education, ENSTAB University, and West Baton Rouge School System to establish a sustainable educational transition from institutions of higher education to the elementary and high schools in the country of Tunisia. \n\n\nThe overarching goal is to close the educational gaps that threaten democracy within the country.  This project will establish a collaboration to address and overhaul infrastructure, technology, capacity building, international students\u2019 exchange, and research initiatives. \n\n\nThis collaboration aims to assist in the repair of the Tunisian educational system in order to lead to career and college readiness for all students.  Furthermore, this project will help to service historically underserved populations, regardless of race, gender, physical ability, income, or geographic location.")],A.a_("u<FX>")))
r($,"aME","aw5",()=>A.a2w("CARTHAGE STUDENT ENTREPRENEUR POLE (PEEC) is an initiative of Carthage University as part of its participation in an Erasmus+ project: SALEEM (Structuration et Accompagnement de l'Entreprenariat Etudiant au Maghreb).\n\nThe project aims to promote the entrepreneurial spirit of UCAR students and encourage their innovative initiatives, in synergy and complementarity with existing actions and structures.\n\nThe main missions of the PEEC cluster are to promote the federation of good entrepreneurial practices and to create the necessary conditions to foster an environment conducive to the creation and development of start-ups by Carthage University students.","assets/associations/peec_projects/peecs/peec_10.jpg","CARTHAGE STUDENT ENTREPRENEUR POLE (PEEC)"))
r($,"aLZ","avL",()=>A.a2w("Within our school, there exists a scientific environment that nurtures the emergence of numerous talents. This environment fosters a diverse range of skills, including a profound mastery of various scientific disciplines, a flair for innovation and creativity, a strong entrepreneurial spirit, and adaptability. This is facilitated by our distinctive pedagogical approach, which places a heavy emphasis on practical application and experiential learning. Students are encouraged to engage actively in their learning journey, which cultivates not only a deep understanding of subjects but also the ability to apply knowledge effectively. Our school's commitment to differentiation ensures that each student's unique strengths and learning style are catered to, fostering an inclusive and supportive learning community. Through this holistic approach, students are equipped not only with academic excellence but also with the tools and mindset to excel in real-world challenges, making them valuable contributors to the ever-evolving scientific landscape.","assets/associations/peec_projects/peec_antenne.jpg","PEEC ANTENNA"))
r($,"aMF","ajf",()=>A.a([A.a2w('Karem Chatti shines as a distinguished individual among our outstanding students, consistently showcasing remarkable dedication and excellence in his academic pursuits. Notably, he actively participates in various projects within the Carthage Student Entrepreneur Center Program (PEEC), demonstrating his prowess in both academia and the world of entrepreneurship. His exceptional aptitude has propelled him to prominence, particularly in the entrepreneurship realm.\n\nAt present, Karem Chatti assumes the pivotal role of CEO at "DeepVolt," a Tunisian startup that stands as a beacon of innovation in the data science field. Specializing in the strategic planning of electric vehicle (EV) charging infrastructure, DeepVolt exemplifies Karem\'s visionary leadership and unwavering commitment. Under his astute guidance, the startup has achieved remarkable success, solidifying its position as a trailblazer in the technological landscape.\n\nDeepVolt, as a pioneering data science enterprise, redefines the deployment of EV charging stations with a strong emphasis on sustainability. Karem, alongside a team of accomplished professionals versed in electric mobility and artificial intelligence (AI), recognizes the indispensability of data analytics for the triumphant establishment of EV charging networks. With a mission to democratize AI solutions, DeepVolt strives to make these cutting-edge technologies accessible to a wide spectrum of individuals.',"assets/associations/peec_projects/peec_projects/startups/peec_1.jpg","START-UP DEEPVOLT"),A.a2w("Our student Wajdi Omrani had expressed his thoughts on the matter, stating that 3D printing industries had been experiencing rapid growth over the years. The student also observed the significant environmental impact caused by plastic waste. In response to these observations, the student shared that this team, CREATIVITY which participated and won the first price of Carthage innov'startup 2.0 competition, had taken the initiative to contribute to this progress while addressing the environmental concerns. Their approach involved making 3D printing more accessible and eco-friendly by repurposing plastic waste into filament, which serves as the raw material for 3D printers. Additionally, the student mentioned CREATIVITY's ambitious goal of developing an affordable and highly efficient 3D printer, entirely designed in Tunisia. This printer would be designed to utilize the CREATIVITY filament, thereby facilitating entry into the world of 3D printing for hobbyists and enthusiasts on a smaller scale.","assets/associations/peec_projects/peec_projects/peec_event/peec_1.jpg","First Price | Carthage Innov'startup 2.0")],A.a_("u<I_>")))
